import React, { useEffect, useRef, useState } from "react";
import { NavLink } from "react-router-dom"
import { gsap } from 'gsap';
import { SplitText } from "gsap/SplitText";
//styles
import '../styles/nav.css';

const Nav = ({ location }) => {
    const pathname = location.pathname;
    const [previousPath, setPreviousPath] = useState(pathname);
    const [collapsed, setCollapsed] = useState(true)
    gsap.registerPlugin(SplitText);
    //nav refs
    let nav = useRef(null);
    let navModal = useRef(null);
    let navButtonBorder = useRef(null);
    let navButtonIcon = useRef(null);
    let navButtonIconLine = useRef(null);
    let navTitle = useRef(null);



    useEffect(() => {
        navTitle.addEventListener('mouseenter', () => { titleAnimation.play() })
        navTitle.addEventListener('mouseleave', () => { titleAnimation.reverse(); console.log('leave') })

    }, []);

    const expandModal = () => {
        setCollapsed(false);
        let ctx = gsap.context(() => {
            const modalTL = gsap.timeline();
            modalTL.to(navModal, {
                duration: 1,
                opacity: 1,
                display: 'flex',
            }, 0)
            modalTL.to(navButtonIcon, {
                duration: 0.4,
                rotate: 0,
                opacity: 1,
                display: 'flex',

            }, 0)
            modalTL.to(navButtonIconLine, {
                duration: 0.4,
                rotate: -90,
                opacity: 1,
                display: 'flex',
            }, 0)
        })
    }

    const collapseModal = () => {
        if (collapsed === false) {
            setCollapsed(true);
            let ctx = gsap.context(() => {
                const modalTL = gsap.timeline();
                modalTL.to(navModal, {
                    duration: 1,
                    opacity: 0,
                    display: 'none',
                }, 0)
                modalTL.to(navButtonIcon, {
                    duration: 0.4,
                    rotate: 90,
                    opacity: 1,
                    display: 'flex',
                }, 0)
                modalTL.to(navButtonIconLine, {
                    duration: 0.4,
                    rotate: 0,
                    opacity: 1,
                    display: 'flex',
                }, 0)

            })
        }
    }

    const toggleModal = () => {
        if (collapsed) {
            expandModal();
        }
        else {
            collapseModal();
        }
    }

    const titleAnimation = gsap.to(navTitle, {
        paused: true,
        opacity: 0
    });



    return (
        <>
            <nav id="nav" ref={el => nav = el} className='nav'>
                <NavLink ref={el => navTitle = el} onClick={() => { collapseModal(); }} to="/" exact='true' className='nav-title'>
                    <div className="nav-title-default">
                        JC
                    </div>
                    <div className="nav-title-hover">
                        Jaime Castaneda
                    </div>
                </NavLink>
                <div className="nav-button">
                    <div ref={el => navButtonBorder = el} className="nav-button-border" />
                    <div ref={el => navButtonIcon = el} onClick={() => { toggleModal(); }} className="nav-button-icon">
                        <div className="nav-button-cross-horizontal" />
                        <div ref={el => navButtonIconLine = el} className="nav-button-cross-vertical" />
                    </div>
                </div>
            </nav>
            <div ref={el => navModal = el} className="nav-modal">
                <ul>
                    <li>
                        <h2>
                            <NavLink onClick={() => { collapseModal(); }} to="/showcase" exact='true'>
                                Showcase
                            </NavLink>
                        </h2>
                    </li>
                    <li>
                        <h2>
                            <NavLink onClick={() => { collapseModal(); }} to="/about" exact='true'>
                                About
                            </NavLink>
                        </h2>
                    </li>
                    <li>
                        <a href="mailto:jccd.designs@gmail.com">
                            <h2>
                                hello@jaimecastaneda.com
                            </h2>
                        </a></li>
                    <li>
                        <h2>
                            +1.408.828.3020
                        </h2>
                    </li>
                </ul>
            </div>
        </>
    );
}

export default Nav;
